	(62, 32, 0, '반도체 털고 전기차로 갑니다', '<p>5월 초부터 투자해서 어제 약 12프로 수익보고 매도했네요</p><p>4차산업혁명의 중심인 반도체도 앞으로의 지속적인 성장성은 무궁무진합니다.</p><p>다만 개인적인 생각으로는 전기차쪽이 투자기간대비 더 나은 수익률을 가져다 줄 것으로 판단하여 전기차쪽으로 투자비중을 옮겨갔네요</p><p>남으신 분들 모두 성투하시고 좋은 수익 내시길 바랍니다</p>', '2021-08-10 11:36:24', '2021-08-10 11:36:24', '해외주식'),
